import React from 'react'

const CustomBtn = ({IconBefore, IconAfter, text}) => {
    return (
        <div className='container flex items-center justify-center w-[80%] h-[3rem] bg-slate-500 rounded'>
            <div role='button' className='bg-slatw-900 w-full h-full flex items-center justify-center gap-2'>
            {IconBefore && <IconBefore />}
                <p>{text}</p>
            {IconAfter && <IconAfter/>}
            </div>
        </div>
    )
}


export default CustomBtn
